import React, { useState, useEffect} from 'react';
import Card from '../Card/card.component';
import PersonInfo from '../PersonInfo/personInfo.component';
import axios from 'axios'

import './home.component.scss'

export default function Home() {

    const [spaceXData, setSpaceXData] = useState

    useEffect(() => {
        fetchFilteredMissions()
    })

    function fetchFilteredMissions(params) {
        let url = 'https://randomuser.me/api/?inc=gender,name,nat,location,picture,email&results= 20https://api.spacexdata.com/v3/launches?limit=100'
        axios.get(url).then(res => {
            if (res) {
                setSpaceXData(res.data);
            }
        });
    }

    return (
        <div className='home-container'>
            <PersonInfo />
            <div className='card-wrapper'>
            {spaceXData && spaceXData.map(spaceXRocket => <Card Rocket={spaceXRocket} />)}

            </div>
        </div>

    )
}
